import {logo} from "../Static/Img/logo.png"
import React, { Component } from "react";

function AppHeader() {
    return (
      <header className="App_header">
        <ul>
          <li>
            <img src="{logo}" alt="Company_logo" />            
          </li>
        </ul>
      </header>
    );
  }

export {AppHeader};
